script: |
  super -f text -I q9667.spq | sort > q9667.out

inputs:
  - name: q9667.spq
    data: |
      SELECT DISTINCT + CAST ( NULL AS INTEGER ) * 96 - + - col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NULL NOT BETWEEN - col0 / - + col0 * - 3 + - 5 * - 30 - + + 59 * - - CAST ( NULL AS INTEGER ) AND - + 62;
  - name: tab0

outputs:
  - name: q9667.out
    data: |
